import { useContext, useEffect, useState } from "react"
import { AppContext } from "../context/AppContext"

function Blog(){

    const {blog,fetchBlog}=useContext(AppContext)

    useEffect(()=>{
        fetchBlog()
    },[])

    return (
        <div>
            <h1 className="text-8xl font-bold text-center">Blog</h1>
            <h1>{blog.title}</h1>
        </div>
    )
}

export default Blog
